
import { useState } from 'react';
import './App.css';

function App() {
  const levels = [
    { name: 'precision', code: '' },
    { name: 'precision part 2', code: '' },
    { name: 'APPELIus-appelnutt CAVE  PART 2', code: '' },
    { name: 'WONDERLAND', code: '' },
    { name: 'ELEMENT', code: '' },
    { name: 'Element II', code: '' },
    { name: 'The hive', code: '' },
    { name: 'korupdt', code: '' },
    { name: 'hello', code: '' },
    { name: 'The seven seas', code: '' }
  ];

  const [randomLevel, setRandomLevel] = useState(null);
  const [copied, setCopied] = useState(false);
  const [showHowTo, setShowHowTo] = useState(false);
  const [showMakeLevel, setShowMakeLevel] = useState(false);

  const handleRandomLevel = () => {
    const level = levels[Math.floor(Math.random() * levels.length)];
    setRandomLevel(level);
    setCopied(false);
    setTimeout(() => {
      setRandomLevel(null);
      setCopied(false);
    }, 15000);
  };

  const handleCopy = () => {
    navigator.clipboard.writeText(randomLevel.code);
    setCopied(true);
    setTimeout(() => setCopied(false), 3000);
    setTimeout(() => {
      setRandomLevel(null);
      setCopied(false);
    }, 15000);
  };

      return (
        <div className="App">
          <header className="App-header">
            {showHowTo ? (
              showMakeLevel ? (
                <div style={{ marginTop: '3rem', textAlign: 'center', color: '#fff' }}>
                  <h2 style={{ color: 'red', fontSize: '2rem' }}>Make Level Instructions</h2>
                  <iframe src="/make-level.pdf" style={{ width: '80vw', height: '70vh', border: '2px solid #000', borderRadius: '8px', background: '#fff' }} title="Make Level PDF" />
                  <br />
                  <button style={{ fontSize: '1rem', padding: '0.5rem 1rem', borderRadius: '6px', border: '2px solid #000', cursor: 'pointer', marginTop: '1rem' }} onClick={() => setShowMakeLevel(false)}>Back</button>
                </div>
              ) : (
                <div style={{ marginTop: '3rem', textAlign: 'center', color: '#fff' }}>
                  <h2 style={{ color: 'red', fontSize: '2rem' }}>How to</h2>
                  <p style={{ fontSize: '1.1rem', color: '#fff', maxWidth: '400px', margin: '2rem auto' }}>
                    Welcome to Appel Codes!<br /><br />
                    1. Click <strong>Random Level</strong> to get a custom level code.<br />
                    2. Use the <strong>Copy</strong> button to copy the code.<br />
                    3. Click <strong>Run Appel</strong> to open the Appel game.<br />
                    4. Click play, then load, and then paste in the code.<br /><br />
                    Have fun!
                  </p>
                  <button style={{ fontSize: '1rem', padding: '0.5rem 1rem', borderRadius: '6px', border: '2px solid #000', cursor: 'pointer', marginRight: '1rem' }} onClick={() => setShowHowTo(false)}>Back</button>
                  <button style={{ fontSize: '1rem', padding: '0.5rem 1rem', borderRadius: '6px', border: '2px solid #000', cursor: 'pointer' }} onClick={() => setShowMakeLevel(true)}>Make Level</button>
                </div>
              )
            ) : (
              <>
                {!randomLevel && (
                  <>
                    <button
                      style={{ margin: '1.3rem 0', padding: '0.65rem 1.3rem', fontSize: '1.3rem', cursor: 'pointer', borderRadius: '7.8px', border: '2.6px solid #000', background: '#fff' }}
                      onClick={() => window.open('/Appel v1.html', '_blank')}
                    >
                      Run Appel
                    </button>
                    <img src="appelimage.jpg" className="App-logo" alt="logo" style={{ width: '260px', height: 'auto' }} />
                    <p style={{ fontSize: '39px' }}>Appel custom level codes</p>
                  </>
                )}
                <p className="small" style={{ fontSize: '20.8px' }}>Click the button to get a random level:</p>
                <button onClick={handleRandomLevel} style={{ padding: '0.65rem 1.3rem', fontSize: '1.3rem', cursor: 'pointer', borderRadius: '7.8px', border: '2.6px solid #000' }}>
                  Random Level
                </button>
                {!randomLevel && (
                  <div style={{
                    background: 'red',
                    color: 'white',
                    fontSize: '0.9rem',
                    borderRadius: '6px',
                    padding: '0.5rem 1rem',
                    margin: '60px auto 0 auto',
                    maxWidth: '220px',
                    fontWeight: 'bold',
                    boxShadow: '0 2px 8px rgba(0,0,0,0.08)',
                    cursor: 'pointer'
                  }} onClick={() => setShowHowTo(true)}>
                    How to
                  </div>
                )}
                {randomLevel && (
                  <div style={{ marginTop: '2.6rem', fontSize: '1.56rem' }}>
                    <strong style={{ fontSize: '1.56rem' }}>Level Name:</strong> {randomLevel.name}<br />
                    <button
                        style={{ marginTop: '1.3rem', background: 'none', border: 'none', padding: 0, cursor: 'pointer' }}
                        onClick={handleCopy}
                        aria-label="Copy Code"
                      >
                        <img src="/copy level.png" alt="Copy Level" style={{ height: '52px', border: '2.6px solid black', borderRadius: '7.8px' }} />
                      </button>
                    <button
                      style={{ marginTop: '1.3rem', padding: '0.65rem 1.3rem', fontSize: '1.3rem', cursor: 'pointer', borderRadius: '7.8px', border: '2.6px solid #000', background: '#fff', display: 'block', marginLeft: 'auto', marginRight: 'auto' }}
                      onClick={() => window.open('/Appel v1.html', '_blank')}
                    >
                      Start Appel
                    </button>
                    {copied && (
                      <div style={{
                        marginTop: '1.3rem',
                        color: '#4caf50',
                        fontWeight: 'bold',
                        display: 'block',
                        fontSize: '1.3rem'
                      }}>
                        Code copied!
                      </div>
                    )}
                  </div>
                )}
              </>
            )}
          </header>
        </div>
      );
}

export default App;
